import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import './navigationbar-styles.css';


import { Link } from "react-router-dom";



class NavigationBar extends Component {

  state = {
    isOpen: false,
    isOpen2: false,
    isOpen3: false,    
    isOpen4: false

  };

  toggleOpen = () => this.setState({ isOpen: !this.state.isOpen });
  toggleOpen2 = () => this.setState({ isOpen2: !this.state.isOpen2 });
  toggleOpen3 = () => this.setState({ isOpen3: !this.state.isOpen3 });
  toggleOpen4 = () => this.setState({ isOpen4: !this.state.isOpen4 });


  render(){
    return (

      <div>
        <Navbar variant="dark" >
        <Navbar.Brand href="/home" className = "navLogo" >
          < img 
            src= "./logo.png"
            width="70"
            height="70"
            alt="EZiBuy logo"
          />
      </Navbar.Brand>
          <Nav className="mr-auto">
            <li><Link className="NavLink" to="/home">EzIBuy</Link></li>
            <li><Link className="NavLink" to="/">Categorias</Link></li>
            <li><Link className="NavLink" to="/login">Ingresar</Link></li>
            <li><Link className="NavLink" to="/">Registrarse</Link></li>
            <li><Link className="NavLink" to="/invoice">...</Link></li>
          </Nav>

          <Form inline>
            <FormControl type="text" placeholder="Buscar" className="mr-sm-2" />
            <Button variant="outline-light">Buscar</Button>
          </Form>
        </Navbar>
      </div>

    );
    }
}

export default NavigationBar;
